Appends an element to the back of the deque, returning a reference to it.

# Examples

```
#![feature(push_mut)]
use std::collections::VecDeque;

let mut d = VecDeque::from([1, 2, 3]);
let x = d.push_back_mut(9);
*x += 1;
assert_eq!(d.back(), Some(&10));
```

